import React from 'react';
import { Heading } from '../heading/heading.js';
import "./home.css"

/**
* @author
* @function Home
**/

export const Home = (props) => {
  return (
    <>
      <div className="home-parent">
        <div className="fetured-articles">
          <div className="featured-article-1"></div><div className="featured-article-2"></div><div className="featured-article-3"></div>
        </div>
        
        <div className="latest-articles">
          <div className="The-Latest-heading">{ Heading }</div>
          <div className="Red-line"></div>
          <div className="latest-article-cards"></div>
        </div>

      </div>
      </>
   )

 }
